import React from 'react';
import './styles.css';

const Result = ({ resultData, isLoading }) => {
  return (
    <div className="column" id="result">
      <h2>Result</h2>
      {isLoading ? <p>Loading...</p> : (resultData ? <p>{resultData}</p> : <p>No result to display</p>)}
    </div>
  );
};

export default Result;
